import React from "react";

export const Title_itemsOfList = (props) => {
  const { item } = props;
  return (
    <div>
      <li
        className={`bg- d-flex justify-content-start align-items-center`}
      >
        <span className={` text-light titleStyle`}>
          {item}
        </span>
      </li>
    </div>
  );
};
